import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const TableComponent = ({ tableData=[], tableHeaderData=[]}) => {

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
              { 
                tableHeaderData.map((item) => 
                 <TableCell align="center">{item}</TableCell>
                 )
              }
          </TableRow>
        </TableHead>
        <TableBody>
          {tableData.map((rowData) => (
            <TableRow key={rowData.id}>
              <TableCell component="th" scope="row" align="center">
                {rowData.first_name}
              </TableCell>
              <TableCell align="center">{rowData.last_name}</TableCell>
              <TableCell align="center">{rowData.email}</TableCell>
              <TableCell align="center">{rowData.phone_number}</TableCell>
              <TableCell align="center">{rowData.status}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default TableComponent;
